import React from "react";

export default function About() {
  return (
    <div className="row col-12 text-center col-md-6">
      <h2>About me</h2>
      <p className="mb-5">
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce in libero
        aliquet, blandit nisl sit amet, finibus dolor. Sed sed est vulputate,
        mollis sem non, convallis purus. Pellentesque habitant morbi tristique
        senectus et netus et malesuada fames ac turpis egestas. Mauris eget
        iaculis eros, at imperdiet.
      </p>
    </div>
  );
}
